import Navbar from "../components/Navbar";
import LoginBox from "../components/LoginBox";
import DetailsBox from "../components/LoginBox";

export default function Register(){
    let display = false;
    return (<div>
        <Navbar></Navbar>
        <DetailsBox display={display} func={"Register"}></DetailsBox>
    </div>);

}
